import React from "react";
import styled from "styled-components";
import MenuPlegable from "../components/MenuPlegable";

const LogoDiscord = "../images/logo.png";
const WrapperMenuPlegable = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
`;

class Develop extends React.Component {
	render() {
		return (
			<WrapperHeader>
				<Logo src="/" />
				<WrapperMenuSearch>
					<WrapperMenu>
						<MenuPlegable />
						<MenuLink>Pricing</MenuLink>
						<MenuPlegable />
						<MenuLink>Login</MenuLink>
					</WrapperMenu>
					<WrapperSearch>
						<Input type="email" placeholder="Your email address" />
						<InputClick type="submit" value="Get started" />
					</WrapperSearch>
				</WrapperMenuSearch>
			</WrapperHeader>
		);
	}
}

export default Develop;
